$(document).ready(function() {

	console.log("Document is ready for testing....");
	var bar = $('#progressBar');
	var barText = $('#progressBarText');
	var status = $('#status');
	var options = {
		beforeSend : function() {
			console.log("Before Send.....");
			//clear bar
			resetProgress();

		},
		uploadProgress : function(event, position, total, percentComplete) {
			console.log("Progress..... "+percentComplete);
			var percentVal = percentComplete + '%';
			bar.width(percentVal);
			barText.html(percentVal);
			if(percentComplete==100){
				status.html("Please wait while processing the file. <i class=\"fa fa-cog fa-spin\"></i>");
			}
		},
		success : function() {
			console.log("On Success.....");
			var percentVal = '100%';
			bar.width(percentVal);
			barText.html(percentVal);
			//clear bar
			$("#fileUploadModal").modal("toggle");
			resetProgress();
		},
		complete : function(xhr) {
			console.log("On Complete.....");

		},

		error : function(xhr, textStatus, errorThrown) {
			console.log("On Error.....");
			status.html("** Invalid/Corrupt file. Please ensure that you use correct template.")
		}
	};

	$("#selectType").change(function() {
		loadFilters($("#selectType").val());
	});

	$('#uploadForm').ajaxForm(options);

	$('#fileUploadModal').on('shown.bs.modal', function() {
	    resetProgress();
	    $("#inputFileDetail").val("");
	});

	$('#fileUploadModal').on('hide.bs.modal', function() {
	    resetProgress();
	    $("#inputFileDetail").val("");
	})

	$( "#sourceRegionform" ).submit(function() {
//		var loadingScreen = $('<div style="position:fixed;top:0;left:0;right:0;bottom:0;z-index:10000;background-color:;background-color:rgba(70,70,70,0.2);"><img style="position:absolute;top:50%;left:50%;width:45px" alt="" src="data:image/gif;base64," /></div>').appendTo($('body')).hide();
		console.log('LOADING .... ');
		showWaitScreen();
	});

	function resetProgress(){
		console.log("reset");
		var percentVal = '0%';
		bar.width(percentVal);
		barText.html(percentVal);
		status.html("");
	}

});

function onFileSelectionChange() {
	var fileObj = $("#inputFile")[0].files[0]
	console.log(fileObj.name);
	$("#inputFileDetail").val(fileObj.name + " ( " + bytesToSize(fileObj.size) + " )");
	var percentVal = '0%';
	 $('#progressBar').width(percentVal);
	 $('#progressBarText').html(percentVal);
	$('#status').html("");

}

function loadFilters(ruleType) {
	var filterUrl = 'filters/' + ruleType;
	console.log("Filter url..." + filterUrl);
	$("#filterSection").load(filterUrl);
}

function showOption(option) {
	console.log("SHOW OPTION : " + option);
	$("#filterSection").html("");
	switch (option) {
	case "table":
		$("#inputFileOption").hide();
		$("#ruleTypeOption").show();
		$("#selectType").prop('required', 'required');
		$("#inputTypeValue").val("table");
		break;
	case "file":
		$("#inputFileOption").show();
		$("#ruleTypeOption").hide();
		$("#selectType").prop('required', false);
		$("#inputTypeValue").val("file");
		break;
	}
	console.log("Selected Type : " + $("#inputTypeValue").val());

}


function bytesToSize(bytes) {
	var sizes = [ 'Bytes', 'KB', 'MB', 'GB', 'TB' ];
	if (bytes == 0)
		return '0 Byte';
	var i = parseInt(Math.floor(Math.log(bytes) / Math.log(1024)));
	return Math.round(bytes / Math.pow(1024, i), 2) + ' ' + sizes[i];
};
